webpackJsonp([9],{iaDX:function(o,n){o.exports="<section><blockquote>\n<p>처음엔 Minecraft에 관심이 있었고, 즐기기만 했어.</p>\n</blockquote>\n<blockquote>\n<p>그러던 와중, 내 서버를 만드는 것에 관심을 갖고 VariableTriggers를 갖고 놀려고 했어.</p>\n</blockquote>\n<blockquote>\n<p>김태룡 카페를 레퍼런스로 하고 많은 것을 익혔어. 아마 저 카페가 없었다면 난 개발계에 발을 들이지 못했을 지도 몰라.</p>\n</blockquote>\n<blockquote>\n<p>그러던 어느 날. MagicSpells를 시작했어, 스킬이 멋져보였으니까.</p>\n</blockquote>\n<blockquote>\n<p>저작권에 대한 인식도 미흡해서 어느 방송인의 방송에서 나온 스킬을 DIY해서 만들었던 적도 있어. 그것 때문에 생긴 인간 관계도 어느정도 있어.</p>\n</blockquote>\n<blockquote>\n<p>Elsiff(구 Efe)님의 UnlimitedRPG를 쓰던 중, 추가하고 싶은 기능이 있던 때가 있었어. 그 때가 내가 처음으로 Java를 만진 때였어.</p>\n</blockquote>\n<blockquote>\n<p>당연히 아무 것도 모른 체로 시작했지. 네이버 검색을 해가며 디컴파일을 하고, 변수를 쓰고… 그런 식으로 개발을 했어. 물론 버그 투성이였지.</p>\n</blockquote>\n<blockquote>\n<p>그렇게 플러그인 개발에 입문하고 나서 Skript란 것을 잠시 만져본 적이 있어. 개인적으로 컨셉은 괜찮지만 그 결과물이 썩 좋지 않은 물건이라고 생각해.</p>\n</blockquote>\n<blockquote>\n<p>그러곤 어느정도 Java 외길 인생을 팠어.</p>\n</blockquote>\n<blockquote>\n<p>기록을 살펴보니 Github 가입이 2015년이야. 레포지토리를 처음 만든 것은 2016년 9월, 텔레그램 가입이 2016년 8월인데 말이지.</p>\n</blockquote>\n<blockquote>\n<p>Java가 아닌 레포지토리가 생긴게 2017년 6월이네. 1년 좀 넘게 팠던 것 같아.</p>\n</blockquote>\n<blockquote>\n<p>어라 디스코드를 사용한 건 2016년 10월 쯤이네.</p>\n</blockquote>\n<blockquote>\n<p>그렇다면 그 전엔 C#을 다뤘다는 거야, 스카이프 유틸을 만들어본 적이 있거든.</p>\n</blockquote>\n<blockquote>\n<p>자랑은 아니지만 꽤나 많은 언어를 익히려고 했고, 기본적인 것은 알고 있어. Scala, Groovy, Java, Kotlin 등등</p>\n</blockquote>\n<blockquote>\n<p>지금 ‘만져 본’ 언어는 Scala, Groovy, Java, Kotlin, TypeScript(JavaScript), Rust, Python, C#, C 등이 있어. 생각해보면 메모리를 직접 만지는 언어는 별로 만지지 않았어.</p>\n</blockquote>\n</section>\n"}});